import React, { useState } from "react";
import Nav from "./Nav"
import '../App.css';

export default function Manager_Profits(props) {
    const [orders, setOrders] = useState([{}]);
    useEffect(() => {

        async function getOrdersProfit() {
            let prod = await fetch("http://localhost:3000/ordersProfit", {
                method: 'GET'
            });
            let pro = await prod.json();
            setOrders(pro);
        }

        getOrdersProfit();
    }, []);
    {/* מספר הזמנה ומחיר הזמנה */ }
    return (<div>
        {orders.map((order) =>
                    (<div>
                        {order.OrderCode}
                        {order.OrderPrice}
                    </div>)
                )}
        </div>);
}
